import React from 'react';
import { useNavigate} from 'react-router-dom';

function Address() {
    
    const navigate = useNavigate();

    function handleClick(){
        navigate("/login")
    }

    return (
        <body>
            <div id="wrapper_address">
                <div id="navbar_address">
                    <ul id="list_address">
                        <a href="/about">Select Plan</a>
                        <a href="/about">Address</a>
                        <a href="/about">Checkout</a>
                        <a href="/about">Select Clothes</a>
                    </ul>
                </div>
                <div id="wrapperAddress_address">
                    
                </div>
                
            </div>
            
        </body>
    )
}

export default Address
